import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
      <div>
        <h1 className="text-5xl text-center">This is Homepage</h1>

        <div className="layout">
              <ul className= "flashcards">
              <li><Link to="/first">First</Link></li>
              </ul>
        </div>
      </div>

      );
    };
export default Home;
